<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>ReadyScope </b>est un oscilloscope à échantillonnage à 4 canaux (tensions de 0 à 5V), avec des fréquences jusqu'à 3kHz.
Il a été réalisé à base de la carte <b>Arduino</b>.
Il dispose d'un générateur de signal <b>PWM</b>&nbsp;(signal rectangulaire) et d'une sortie d'onde carrée (signal carré).

Il peut également identifier automatiquement la valeur de la résistance ou du condensateur à l'aide de 3 échelles pour une meilleure approximation.&nbsp;Il a été testé sur l'ordinateur à base du simulateur de circuits électroniques <b>Proteus</b>. Il communique les échantillons de données à l'ordinateur à travers le port série <b>UART</b>. Il présente les signaux sur l'ordinateur grâce une <b>IHM</b>&nbsp;développée à base du langage de programmation <b>Processing</b>.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
