void lerSerial() {
  char c;
  int k;
  ...
  if (Serial.available() &gt; 0) {
    c = Serial.read();
    switch (c) {
      ...
      case 'd':
        k = Serial.parseInt();
        if (k &gt;= 1 &amp;&amp; k &lt;= 30000) {
          dt = k;
        }
        c = Serial.read();
        if (c == 'u' || c == 'm') {
          unidade = c;
        } else {
          unidade = 'm';
          dt *= 1000;
        }
        Serial.print("dt=");
        Serial.print(dt);
        Serial.println(unidade);
        break;
      ...
    }
  }
}
